import React, { useState, useEffect } from 'react';
import RoomCard from '../components/RoomCard';

const FindReserve = () => {
  const [rooms, setRooms] = useState([]);

  useEffect(() => {
    const fetchRooms = async () => {
      try {
        const requestBody = {
          chainName: "",
          location: "",
          capacity: 0,
          minPrice: 0,
          maxPrice: 10000,
          rating: 0
        };

        const response = await fetch('http://localhost:8080/findAndReserve/rooms', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(requestBody),
        });

        if (!response.ok) {
          throw new Error('Failed to fetch rooms');
        }

        const data = await response.json();
        // Assuming the response data structure matches your example
        const roomsArray = Object.values(data).flat();
        setRooms(roomsArray);
      } catch (error) {
        console.error("Error fetching rooms:", error);
      }
    };

    fetchRooms();
  }, []);

  return (
    <div className="find-reserve-container">
      <div className="rooms-container">
        {rooms.length > 0 ? (
          rooms.map((room, index) => (
            <RoomCard key={index} room={room} />
          ))
        ) : (
          <p>No rooms available</p>
        )}
      </div>
    </div>
  );
};

export default FindReserve;
